import Links from "./navlinks";
import { NavlinkWrapper, NavLinkMobile, NavLinkDesktop } from "./styles";
const SocialMediaLinks = () => (
	<NavlinkWrapper>
		<NavLinkMobile>
			<Links />
		</NavLinkMobile>
		<NavLinkDesktop>
			<Links />
		</NavLinkDesktop>
	</NavlinkWrapper>
);
export default SocialMediaLinks;
